import { useEffect } from 'react';
import RecipeCard from './RecipeCard';

function RecipeList() {
  useEffect(() => {
    fetch('http://localhost:3000/recipes')
      .then((res) => res.json())
      .then((data) => data.map((recipe) => <RecipeCard recipe={recipe} />));
  }, []);
  return;
}

export default RecipeList;
